import style from './Category.module.css'
import Category_container from './Category_container'

function Category({}) {
  return (
    <div className={style.container}>
        <Category_container className={style.container1}>2022</Category_container>
        <Category_container className={style.container2}>2021</Category_container>
        <Category_container className={style.container3}>2020</Category_container>
        <Category_container className={style.container4}>2019</Category_container>
    </div>
  );
}

export default Category;
